Всё ещё думаешь, куда поступать? Рассмотрел уже тысячу вариантов, но всё никак не выберешь?

Евгений выбрал нашу Академию по нескольким причинам:
- удобное расположение вуза (5 минут от метро Полежаевская);
- наличие интересующего направления;
- частный вуз с государственным дипломом;
- отсрочка от армии.

Задавай свои вопросы о поступлении нам в сообщения vk.me/aup_official, а за вступление в сообщество мы дарим 5% скидку при подаче документов.
